import React from "react"

import Joke from "./Joke"
import jokeData from "./jokeData"

function App() {
  const jokeComponent = jokeData.map(joke => <Joke key={props.joke.id} question={props.joke.question} punchline={props.joke.punchline} />)

  return(
      <div>
          {joke.jokeComponent}
      </div>
  )
}

export default App
